import React, { Component } from 'react';
import "./App.css";
import PieChart from './Widgets/PieChart'

class Dashboard extends Component {
    render() {
        return (
            <div className="Container">
                <h1>Dashboard</h1>
                <div>
                    <PieChart/>
                </div>
            </div>
        )
    }
}

export default Dashboard;
